public class InnerExperimentTemplateExperimentTemplateLogConfigurationFactory(Action<Humidifier.FIS.ExperimentTemplateTypes.ExperimentTemplateLogConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.FIS.ExperimentTemplateTypes.ExperimentTemplateLogConfiguration>
{

    internal InnerExperimentTemplateS3ConfigurationFactory S3ConfigurationFactory { get; set; }

    internal InnerExperimentTemplateCloudWatchLogsConfigurationFactory CloudWatchLogsConfigurationFactory { get; set; }

    protected override Humidifier.FIS.ExperimentTemplateTypes.ExperimentTemplateLogConfiguration Create()
    {
        var experimentTemplateLogConfigurationResult = CreateExperimentTemplateLogConfiguration();
        factoryAction?.Invoke(experimentTemplateLogConfigurationResult);

        return experimentTemplateLogConfigurationResult;
    }

    private Humidifier.FIS.ExperimentTemplateTypes.ExperimentTemplateLogConfiguration CreateExperimentTemplateLogConfiguration()
    {
        var experimentTemplateLogConfigurationResult = new Humidifier.FIS.ExperimentTemplateTypes.ExperimentTemplateLogConfiguration();

        return experimentTemplateLogConfigurationResult;
    }
    public override void CreateChildren(Humidifier.FIS.ExperimentTemplateTypes.ExperimentTemplateLogConfiguration result)
    {
        base.CreateChildren(result);

        result.S3Configuration ??= S3ConfigurationFactory?.Build();
        result.CloudWatchLogsConfiguration ??= CloudWatchLogsConfigurationFactory?.Build();
    }

} // End Of Class

